document.addEventListener('DOMContentLoaded', function () {
  function updateCartCount() {
    var animated = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : false;
    var cartCount = document.getElementById('cart-count');
    if (!cartCount) return;
    var panier = JSON.parse(localStorage.getItem('panier')) || [];
    var total = panier.reduce(function (sum, item) {
      return sum + item.qty;
    }, 0);
    cartCount.textContent = total > 0 ? total : '';
    if (animated) {
      cartCount.classList.add('bump');
      setTimeout(function () {
        return cartCount.classList.remove('bump');
      }, 200);
    }
  }

  //  Boutons Ajouter au panier 
  document.querySelectorAll('.btn-ajouter-panier').forEach(function (button) {
    button.addEventListener('click', function () {
      var id = button.dataset.id;
      var nom = button.dataset.nom;
      var prix = parseFloat(button.dataset.prix);

      // R√©cup√©rer le panier
      var panier = JSON.parse(localStorage.getItem('panier')) || [];

      // V√©rifier si l'item est d√©j√† dans le panier
      var existing = panier.find(function (item) {
        return item.id == id;
      });
      if (existing) {
        existing.qty += 1;
      } else {
        panier.push({
          id: id,
          nom: nom,
          prix: prix,
          qty: 1,
          suppl√©ments: []
        });
      }

      // Sauvegarder
      localStorage.setItem('panier', JSON.stringify(panier));

      // Mise √† jour du badge
      updateCartCount(true);

      // Optionnel : alert ou toast
      alert("\uD83C\uDF55 ".concat(nom, " ajout\xE9 au panier !"));
    });
  });

  // Initialiser le badge
  updateCartCount();
});

